import { BrowserRouter, Route, Routes } from "react-router-dom";
import { Home } from "../components/Home";
import { LoginAdmin } from "../components/LoginAdmin";
import { LoginEmployee } from "../components/LoginEmployee";
import { AdminInfoList } from "../components/AdminInfoList";
import { AdminInfoDetail } from "../components/AdminInfoDetail";
import { AdminInfoResister } from "../components/AdminInfoResister";
import { EmployeeInfoList } from "../components/EmployeeInfoList";
import { EmployeeInfoDetail } from "../components/EmployeeInfoDetail";
import { EmployeeInfoResister } from "../components/EmployeeInfoResister";
import { EmployeeInfoEdit } from "../components/EmployeeInfoEdit";
import { Page404 } from "../components/Page404";
export const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home></Home>} />
        <Route path="/loginAdmin" element={<LoginAdmin></LoginAdmin>} />
        <Route
          path="/loginEmployee"
          element={<LoginEmployee></LoginEmployee>}
        />
        <Route
          path="/adminInfoList/:userId"
          element={<AdminInfoList></AdminInfoList>}
        />
        <Route
          path="/adminInfoDetail"
          element={<AdminInfoDetail></AdminInfoDetail>}
        />
        <Route
          path="/adminInfoResister"
          element={<AdminInfoResister></AdminInfoResister>}
        />
        <Route
          path="/employeeInfoList"
          element={<EmployeeInfoList></EmployeeInfoList>}
        />
        <Route
          path="/employeeInfoDetail"
          element={<EmployeeInfoDetail></EmployeeInfoDetail>}
        />
        <Route
          path="/employeeInfoResister"
          element={<EmployeeInfoResister></EmployeeInfoResister>}
        />
        <Route
          path="/employeeInfoEdit"
          element={<EmployeeInfoEdit></EmployeeInfoEdit>}
        />
        <Route path="/*" element={<Page404></Page404>} />
      </Routes>
    </BrowserRouter>
  );
};
